.canvas-color-picker-item.canvas-color-p.value:
conic-gradient(
    var(--color-red),
    var(--color-yellow),
    var(--color-green),
    var(--color-blue),
    var(--color-purple),
    var(--color-red)
  )

.check-bg .markdown-source-view.mod-cm6.value:
linear-gradient(
    to left,
    var(--accent, var(--interactive-accent)) 0%,
    transparent 1%
  )

.check-bg :is(ul, ol) > li[data-task=\"/.value:
linear-gradient(
    to left,
    var(--accent, var(--interactive-accent)) 0%,
    transparent 1%
  )
